@bojidar.andreev.31 (81kg, Bulgaria) clean and jerking 198kg/436.5lb to win the 2019 European U23s!  And check out the crazy mid air jerk regrip!
———
He’s usually a 73 but he lifted up a category to get in a post-WWC meet and points for Olympic qualification.  His category in Tokyo will almost certainly be 73.

@iammasanori9723 (73kg, @hkgrpjapan) clean and jerking 190kg/419lb!  This makes him one of ten 73s to hit the 190 level: Shi Zhiyong, CJ Cummings, Bozhidar Andreev, Won Jeongsik, Bak Joohyo, Yuan Chengfei, O Kang Chol, Nijat Rehimov and Julio Mayora.  With Shi likely taking gold, Yuan being bumped by Shi and Bak or Won not being on the team, that leaves 6 lifters to fit into two medal spots.
——
Thanks to @take_kasai for sending this video in! #repost
